import React from 'react';
import {
  Box,
  Container,
  Grid,
  Paper,
  Typography,
  Avatar,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  Divider,
  Card,
  CardContent,
  Button,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import {
  History as HistoryIcon,
  Bookmark as BookmarkIcon,
  Notifications as NotificationsIcon,
  Settings as SettingsIcon,
} from '@mui/icons-material';
import { motion } from 'framer-motion';

const DashboardCard = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(3),
  height: '100%',
  background: 'rgba(255, 255, 255, 0.9)',
  backdropFilter: 'blur(10px)',
  borderRadius: theme.spacing(2),
  boxShadow: '0 4px 20px rgba(0,0,0,0.1)',
}));

const StyledAvatar = styled(Avatar)(({ theme }) => ({
  width: theme.spacing(12),
  height: theme.spacing(12),
  marginBottom: theme.spacing(2),
  border: `4px solid ${theme.palette.primary.main}`,
}));

const UserDashboard = () => {
  // Mock user data
  const user = {
    name: 'John Doe',
    email: 'john.doe@example.com',
    avatar: 'https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?auto=format&fit=crop&w=200&q=80',
    recentSearches: [
      'Cybercrime Laws India',
      'Digital Privacy Rights',
      'Supreme Court Judgments 2024',
    ],
    savedCases: [
      'Smith vs State of California',
      'Digital Rights Foundation Case',
      'Privacy Protection Act Case',
    ],
    notifications: [
      'New judgment added in your saved category',
      'Updates to privacy law case',
      'New related case found',
    ],
  };

  return (
    <Box
      sx={{
        minHeight: '100vh',
        pt: 10,
        pb: 4,
        background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
      }}
    >
      <Container maxWidth="lg">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <Grid container spacing={4}>
            {/* Profile Section */}
            <Grid item xs={12} md={4}>
              <DashboardCard>
                <Box display="flex" flexDirection="column" alignItems="center">
                  <StyledAvatar src={user.avatar} alt={user.name} />
                  <Typography variant="h5" gutterBottom>
                    {user.name}
                  </Typography>
                  <Typography variant="body2" color="text.secondary" gutterBottom>
                    {user.email}
                  </Typography>
                  <Button
                    variant="outlined"
                    color="primary"
                    sx={{ mt: 2 }}
                    startIcon={<SettingsIcon />}
                  >
                    Edit Profile
                  </Button>
                </Box>
              </DashboardCard>
            </Grid>

            {/* Activity Section */}
            <Grid item xs={12} md={8}>
              <Grid container spacing={3}>
                {/* Recent Searches */}
                <Grid item xs={12}>
                  <DashboardCard>
                    <Box display="flex" alignItems="center" mb={2}>
                      <HistoryIcon color="primary" sx={{ mr: 1 }} />
                      <Typography variant="h6">Recent Searches</Typography>
                    </Box>
                    <List>
                      {user.recentSearches.map((search, index) => (
                        <ListItem key={index} button>
                          <ListItemText primary={search} />
                        </ListItem>
                      ))}
                    </List>
                  </DashboardCard>
                </Grid>

                {/* Saved Cases */}
                <Grid item xs={12} md={6}>
                  <DashboardCard>
                    <Box display="flex" alignItems="center" mb={2}>
                      <BookmarkIcon color="primary" sx={{ mr: 1 }} />
                      <Typography variant="h6">Saved Cases</Typography>
                    </Box>
                    <List>
                      {user.savedCases.map((item, index) => (
                        <ListItem key={index} button>
                          <ListItemText primary={item} />
                        </ListItem>
                      ))}
                    </List>
                  </DashboardCard>
                </Grid>

                {/* Notifications */}
                <Grid item xs={12} md={6}>
                  <DashboardCard>
                    <Box display="flex" alignItems="center" mb={2}>
                      <NotificationsIcon color="primary" sx={{ mr: 1 }} />
                      <Typography variant="h6">Notifications</Typography>
                    </Box>
                    <List>
                      {user.notifications.map((notification, index) => (
                        <ListItem key={index} button>
                          <ListItemText 
                            primary={notification}
                            secondary={`${Math.floor(Math.random() * 24)}h ago`}
                          />
                        </ListItem>
                      ))}
                    </List>
                  </DashboardCard>
                </Grid>
              </Grid>
            </Grid>
          </Grid>
        </motion.div>
      </Container>
    </Box>
  );
};

export default UserDashboard;
